import React from 'react';
import '../PageTable.css';

const PageTable = () => {
    return (
        <div className="container-fluid">
        <div className="row">
            <div className="col-md-4 col-lg-3 navbar-container bg-light">

            </div>
            <div className="col-md-8 col-lg-9 content-container" style="background-color: #ffe0b2">
                <h1 className="h3 text-center mt-5">Bootstrap 4 - Navbar (основное меню)</h1>
                <h2 className="lead text-center">создание схлопывающегося вертикального меню</h2>

                <section>
                </section>
            </div>
        </div>
    </div>
    )
}

export default PageTable;
